package com.auros.model;

import com.emergent.e2ks.types.KPac;

public class KPacAc {
	
	String kpacKey;
	
	String copID;
	String kpacID;
	String kpacVersion;
	
	KPac kpac;
	

	public KPacAc() {
		// TODO Auto-generated constructor stub
	}


	public String getKpacKey() {
		return kpacKey;
	}


	public void setKpacKey(String kpacKey) {
		this.kpacKey = kpacKey;
	}


	public String getCopID() {
		return copID;
	}


	public void setCopID(String copID) {
		this.copID = copID;
	}


	public String getKpacID() {
		return kpacID;
	}


	public void setKpacID(String kpacID) {
		this.kpacID = kpacID;
	}


	public String getKpacVersion() {
		return kpacVersion;
	}


	public void setKpacVersion(String kpacVersion) {
		this.kpacVersion = kpacVersion;
	}


	public KPac getKpac() {
		return kpac;
	}


	public void setKpac(KPac kpac) {
		this.kpac = kpac;
	}
	

	
	

}
